import { StyleSheet, Text, TextInput, TouchableOpacity, View } from "react-native";
const Rooms = () => {
	return (
		<View>
			<Text>Number</Text>
			<TextInput />
			<TouchableOpacity>
				<Text>Send</Text>
			</TouchableOpacity>
		</View>
	);
};

export default Rooms;
